import React, { useState,useEffect }from "react";
import SmallPersonRun from "../../../assets/img/small-person-run.svg";
import FirstBoxChart from "../../../assets/img/first-box-chart.svg";
import Cookies from 'universal-cookie'
import BASE_URL from "../../pages/base";

const cookies = new Cookies();

function FirstPlanBox({ TrackPlanBox ,plandetails}) {
  const [getpackage, setpackage] = useState([])
  const cookies = new Cookies();
  const axios = require('axios');

  useEffect(() => {
    axios
    .get(BASE_URL + 'user/subscription/user/?uuid='+cookies.get('uuid')+'&gym_id='+cookies.get('gym_id'))
    .then(getuuid => {
        setpackage(getuuid.data);
    })

    .catch(err => {
        console.log(err);
    })
    // console.clear();
    // console.log(plandetails)
    // setpackage(plandetails);
}, [])

  return (
    <div className="active-plan-ui-box">
      <div className="plan-box-three-dots">
        <svg
          className={`${TrackPlanBox == 1 && "active"}`}
          xmlns="http://www.w3.org/2000/svg"
          width="7"
          height="7"
          viewBox="0 0 7 7">
          <g
            id="Ellipse_29"
            data-name="Ellipse 29"
            fill="#fff"
            stroke="#707070"
            stroke-width="1">
            <circle cx="3.5" cy="3.5" r="3.5" stroke="none" />
            <circle cx="3.5" cy="3.5" r="3" fill="none" />
          </g>
        </svg>

        <svg
          className={`${TrackPlanBox == 2 && "active"}`}
          xmlns="http://www.w3.org/2000/svg"
          width="7"
          height="7"
          viewBox="0 0 7 7">
          <g
            id="Ellipse_29"
            data-name="Ellipse 29"
            fill="#fff"
            stroke="#707070"
            stroke-width="1">
            <circle cx="3.5" cy="3.5" r="3.5" stroke="none" />
            <circle cx="3.5" cy="3.5" r="3" fill="none" />
          </g>
        </svg>

        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="7"
          height="7"
          viewBox="0 0 7 7">
          <g
            id="Ellipse_29"
            data-name="Ellipse 29"
            fill="#fff"
            stroke="#707070"
            stroke-width="1">
            <circle cx="3.5" cy="3.5" r="3.5" stroke="none" />
            <circle cx="3.5" cy="3.5" r="3" fill="none" />
          </g>
        </svg>
      </div>
      <div className={"left "+cookies.get('theme')}>
        <p>Class Package</p>

        <div className="left-bottom">
          <img src={SmallPersonRun} />
          {/* <img src={FirstBoxChart} /> */}

          <div className="counter-main">
          <p> <span> {getpackage.total_classes} </span> </p>
          {/* {getpackage.package_class_passes}/ */}
      </div>
        </div>
      </div>

      {(() => {
        if (getpackage.uuid){
      return(<div className="right ">
        <p className={"class-package-count"}>
        <p className={cookies.get('theme')+'t'}> {getpackage.package_class_passes} Classes left  </p></p>

        {/* <p> {getpackage.package}</p> */}
        <div className="active-plan-ui-time">
          <h5></h5>

          <p className={cookies.get("theme")+"t"}>
          {getpackage.days_left}<span>Days Left</span>
          </p>
        </div>
        <p class={"expire-time "+cookies.get("theme")+"t"}>
          Ends by <span>{getpackage.subscription_validity}</span>
        </p>

    </div>
    )
        }
        else{
            return(
                <>

                <p className="rd-right"> <strong>No Active Package</strong>
                <div><span><i>To Purchase a Package,Click on the "plans & Packages" tab</i></span></div>


                </p>


                </>
            )
        }
          })()}
                </div>  
  );
}

export default FirstPlanBox;

